import{_ as e,c as r,o as i,ag as t}from"./chunks/framework.bCALENAD.js";const m=JSON.parse('{"title":"Cris是谁？","description":"","frontmatter":{"outline":"deep"},"headers":[],"relativePath":"profile/who-is-cris.md","filePath":"profile/who-is-cris.md","lastUpdated":1770900850000}'),l={name:"profile/who-is-cris.md"};function o(s,a,n,c,d,p){return i(),r("div",null,[...a[0]||(a[0]=[t('<h1 id="cris是谁" tabindex="-1">Cris是谁？ <a class="header-anchor" href="#cris是谁" aria-label="Permalink to &quot;Cris是谁？&quot;">​</a></h1><h2 id="👋-个人介绍" tabindex="-1">👋 个人介绍 <a class="header-anchor" href="#👋-个人介绍" aria-label="Permalink to &quot;👋 个人介绍&quot;">​</a></h2><p>你好！我是 Cris，一名热爱技术、追求简洁与体验的前端开发者，也是这份学习笔记的作者与长期维护者。</p><p>我的前端之旅始于大四——那时的我，面对浏览器中的代码与像素，第一次感受到“创造”的乐趣。硕士期间，我系统自学了 HTML、CSS、JavaScript 及现代前端框架，并通过大量实践项目不断打磨工程化思维与解决问题的能力。</p><p>2022年毕业后，我正式踏入前端行业。第一次实习，是在深圳顺丰科技做saas服务。第一份工作，是在南京荣耀手机做海外商城开发。现在回到了老家，在青岛海尔依然从事着商城前端开发。我的履历都是toC项目，因此我一直秉承着：“前端不仅是界面的实现者，更是用户体验的守护者与性能的优化者”的信念。</p><p>这份笔记建立的初衷只是觉得自己学习笔记格式繁杂，有word、pdf、md、截图等等，想整理一下。转念一想，我作为前端工作者，自己用低成本搭建一个服务写笔记也未尝不可。虽然刚刚起步，但希望它能逐渐成长为一个持续迭代的技术仓库。记录我的思考、踩过的坑、学到的新范式，也见证我从“能跑就行”到“优雅可靠”的成长轨迹。</p><div class="tip custom-block"><p class="custom-block-title">💪💪💪</p><p>技术日新月异，但热爱始终如一。<br> 愿与你一起，在代码的世界里，保持好奇，持续精进。</p></div><h2 id="🎯-技术方向" tabindex="-1">🎯 技术方向 <a class="header-anchor" href="#🎯-技术方向" aria-label="Permalink to &quot;🎯 技术方向&quot;">​</a></h2><ul><li><strong>前端开发</strong>: <em>Vue.js、Nuxt、JavaScript、TypeScript、小程序、H5、React(todo)</em></li><li><strong>全栈开发</strong>: <em>Node.js、Express、MySQL、AEM、Java(learning)</em></li><li><strong>跨端开发</strong>: <em>Electron、Uniapp、React Native(todo)</em></li><li><strong>工具链</strong>: <em>Vite、Webpack、Git</em></li><li><strong>DevOps</strong>: <em>Linux</em></li></ul><h2 id="📚-学习与分享" tabindex="-1">📚 学习与分享 <a class="header-anchor" href="#📚-学习与分享" aria-label="Permalink to &quot;📚 学习与分享&quot;">​</a></h2><p>创建这个笔记的初衷是为了：</p><ol><li><strong>系统化整理</strong>自己学习过程中的知识点</li><li><strong>记录</strong>解决问题的思路和方案</li><li><strong>分享</strong>技术见解和最佳实践</li><li><strong>回顾与总结</strong>，不断提升自己</li></ol><h2 id="💡-技术理念" tabindex="-1">💡 技术理念 <a class="header-anchor" href="#💡-技术理念" aria-label="Permalink to &quot;💡 技术理念&quot;">​</a></h2><ul><li>代码不仅要能运行，还要易于维护和扩展</li><li>持续学习，拥抱新技术</li><li>重视用户体验，从细节做起</li><li>分享创造价值，开源精神</li></ul><h2 id="📫-联系方式" tabindex="-1">📫 联系方式 <a class="header-anchor" href="#📫-联系方式" aria-label="Permalink to &quot;📫 联系方式&quot;">​</a></h2><ul><li>GitHub: <a href="https://github.com/HelloCris" target="_blank" rel="noreferrer">@Cris</a></li><li>Email: <a href="mailto:wgxyyds97@163.com" target="_blank" rel="noreferrer">wgxyyds97@163.com</a></li></ul>',16)])])}const u=e(l,[["render",o]]);export{m as __pageData,u as default};
